    false,nt"url": null,nt"notes": "This annual narrative report for Glen L.
    Martin National Wildlife Refuge outlines Refuge accomplishments during the 1972
    calendar year. The report begins by summarizing the weather conditions, habitat
    conditions, water conditions, and food and cover conditions during the year. Wildlife-
    including migratory birds, furbearers, mammals, raptors, and reptiles- is also covered.
    The Refuge development and maintenance section discusses physical developments.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, fishing, and safety. Items of interest, N-R forms, and photographs
    are included.",nt"license_title": "License Not Specified",nt"extras":
